    fr: 'Loading...',
    de: 'SERVERFEHLER. Ihre Studie scheint auf dem Pavlovia-Server nicht verfügbar zu sein (404). Dies kann verschiedene Ursachen haben. So beheben Sie das Problem:\n1. Möglicherweise handelte es sich um ein vorübergehendes Problem, das jetzt behoben ist. Pavlovia hat die Studie möglicherweise nur langsam bereitgestellt, oder es gab einen vorübergehenden Ausfall aufgrund hohen Serververkehrs. Aktualisieren Sie die Studienseite, indem Sie in der Adressleiste Ihres Browsers auf die Schaltfläche „Aktualisieren“ ↻ klicken. Sie können es mehrmals versuchen. Sobald die Studie verfügbar ist, läuft sie normal.\n2. Andernfalls klicken Sie auf der EasyEyes-Compiler-Seite unten rechts auf die Schaltfläche „Zu Pavlovia“, um das Pavlovia-Dashboard für Ihre Studie zu öffnen.\n3. Stellen Sie im Pavlovia-Dashboard sicher, dass Ihre Studie im Modus „LÄUFT“ ist. Wenn sie INAKTIV ist, klicken Sie auf die Schaltfläche „LÄUFT“. Ihre Studie wechselt innerhalb von zwei Sekunden in den Modus „LÄUFT“ und kann nun normal ausgeführt werden. Gehen Sie zurück zur EasyEyes-Compiler-Seite und klicken Sie auf „AUSFÜHREN“ oder verwenden Sie die Studien-URL.\n4. Wenn Ihre nicht verfügbare Studie bereits im Modus „AUSFÜHREN“ ist, weist dies in der Regel darauf hin, dass Sie nicht über ausreichend Guthaben/Lizenz für die Online-Tests verfügen. Sie haben drei Möglichkeiten, wie Sie vorgehen können.\n5. KOSTENLOSER PILOTTEST ÜBER DAS PAVLOVIA-DASHBOARD. Klicken Sie im Pavlovia-Dashboard auf die Schaltfläche „PILOTTEST“, um Ihre Studie in den PILOTTEST-Modus zu versetzen. Starten Sie Ihre Studie, indem Sie im Pavlovia-Dashboard auf die Schaltfläche „PILOTTEST“ klicken. Das ist kostenlos, aber Ihre Studien-URL ist dann nicht verfügbar.\n6. ONLINE MIT GUTHABEN DURCHFÜHREN. Um die Studie online durchzuführen, können Sie im selben Dashboard Guthaben von Pavlovia kaufen und einige Guthaben dieser Studie zuweisen. Dadurch kann die Studie online durchgeführt werden.\n7. ONLINE MIT LIZENZ DURCHFÜHREN. EasyEyes verfügt über eine Standortlizenz für Pavlovia. Schreiben Sie an denis.pelli@nyu.edu und bitten Sie darum, dass Ihre E-Mail-Adresse in die EasyEyes Pavlovia-Lizenz aufgenommen wird. (Wenn Ihre Institution über eine Pavlovia-Lizenz verfügt, können Sie diese stattdessen verwenden.) Geben Sie Ihre E-Mail-Adresse im Pavlovia-Dashboard an, um Ihre Lizenz nachzuweisen. Pavlovia speichert diese für zukünftige Sitzungen. So können Sie alle Ihre Studien online durchführen.',
