    ro: 'EROARE DE SERVER. Studiul dvs. pare a fi indisponibil (404) pe serverul Pavlovia. Există mai multe moduri în care acest lucru se poate întâmpla. Iată cum să remediați problema:\n1. S-ar putea să fi fost o problemă de moment, acum dispărută. Poate că Pavlovia a întârziat să pună la dispoziție studiul sau a existat o întrerupere temporară din cauza traficului mare de server. Încercați să reîmprospătați pagina de studiu făcând clic pe butonul de reîmprospătare ↻ din bara de adrese a browserului dvs. Puteți încerca de mai multe ori. Dacă devine disponibil, studiul dumneavoastră se va desfășura normal.\n2. În caz contrar, pe pagina compilatorului EasyEyes, faceți clic pe butonul „Mergeți la Pavlovia” (partea dreapta jos a paginii) pentru a deschide tabloul de bord Pavlovia pentru studiul dumneavoastră.\n3. În tabloul de bord Pavlovia, asigurați-vă că studiul este în modul „RUNNING”. Dacă este INACTIV, atunci apăsați butonul RUNNING. În două secunde, studiul dumneavoastră va trece în modul RUNNING și acum poate rula normal. Reveniți la pagina compilatorului EasyEyes și faceți clic pe RUN sau utilizați adresa URL a studiului.\n4. Dacă studiul dvs. indisponibil este deja în modul RUNNING, aceasta indică de obicei că studiul dvs. nu are credit/licență pentru a plăti pentru testarea online. Există trei moduri de a proceda.\n5. PILOTĂ GRATIS DE LA BORDA PAVLOVIA. Dacă doriți, puteți face clic pe butonul PILOTING din tabloul de bord Pavlovia pentru a vă pune studiul în modul PILOTING. Rulați-vă studiul apăsând butonul PILOT (în tabloul de bord Pavlovia). Este gratuit, dar adresa URL a studiului dvs. rămâne indisponibilă.\n6. RELAȚI ONLINE CU CREDIT. Pentru a rula online, în același tablou de bord puteți cumpăra credite de la Pavlovia și puteți atribui câteva acestui studiu. Acest lucru va permite acestui studiu să se desfășoare online.\n7. RULĂȚI ONLINE CU LICENȚĂ. EasyEyes are o licență de site pentru Pavlovia. Scrieți la denis.pelli@nyu.edu și cereți ca e-mailul dvs. să fie inclus în licența site-ului EasyEyes Pavlovia. (Sau, dacă instituția dvs. are o licență de site Pavlovia, o puteți utiliza în schimb.) Furnizați adresa dvs. de e-mail la tabloul de bord Pavlovia pentru a arăta că aveți licență, ceea ce Pavlovia își va aminti în sesiunile viitoare. Acest lucru vă permite să desfășurați toate studiile online.',
    ru: 'Loading...',
    sr: 'ГРЕШКА СЕРВЕРА. Чини се да ваша студија није доступна (404) на Павловиа серверу. Постоји неколико начина на које се то може догодити. Ево како да решите проблем:\n1. Можда је то био тренутни проблем, сада нестао. Можда је Павловиа споро стављала студију на располагање или је дошло до привременог прекида рада због великог саобраћаја на серверу. Покушајте да освежите страницу за проучавање тако што ћете кликнути на дугме за освежавање ↻ у адресној траци прегледача. Можете покушати више пута. Ако постане доступно, ваша студија ће радити нормално.\n2. Ако то не успе, на страници компајлера ЕасиЕиес кликните на дугме „Иди на Павловиа“ (доња десна страна странице) да бисте отворили Павловиа контролну таблу за своју студију.\n3. На контролној табли Павловиа, проверите да ли је ваша студија у режиму „РУННИНГ“. Ако је НЕАКТИВАН, притисните дугме РУННИНГ. За две секунде ваша студија ће се пребацити у режим ТРЧАЊЕ и сада може да ради нормално. Вратите се на страницу компајлера ЕасиЕиес и кликните на РУН или користите УРЛ студије.\n4. Ако је ваша недоступна студија већ у режиму РУННИНГ, то обично указује да вашој студији недостаје кредит/лиценца за плаћање онлајн тестирања. Постоје три начина да се настави.\n5. ПИЛОТ БЕСПЛАТНО СА КОНТРОЛНЕ ТАБЛЕ ПАВЛОВИА. Ако желите, можете да кликнете на дугме ПИЛОТИРАЊЕ на контролној табли Павловиа да бисте своју студију поставили у режим ПИЛОТИРАЊА. Покрените своју студију притиском на дугме ПИЛОТ (на контролној табли Павловиа). То је бесплатно, али УРЛ ваше студије остаје недоступан.\n6. ТРЧИТЕ ОНЛИНЕ СА КРЕДИТОМ. Да бисте радили на мрежи, на истој контролној табли можете купити кредите од Павловиа-е и доделити неке овој студији. То ће омогућити да се ова студија покрене на мрежи.\n7. РАДИТЕ ОНЛИНЕ СА ЛИЦЕНЦОМ. ЕасиЕиес има лиценцу за сајт за Павловиа. Пишите на денис.пелли@ниу.еду и затражите да ваша е-пошта буде укључена у лиценцу сајта ЕасиЕиес Павловиа. (Или, ако ваша институција има лиценцу за веб локацију Павловиа, можете је користити уместо тога.) Наведите своју адресу е-поште на Павловиа контролној табли да бисте показали да сте лиценцирани, што ће Павловиа запамтити у будућим сесијама. Ово омогућава да све ваше студије буду онлајн.',
