    ur: 'سرور کی خرابی۔ ایسا لگتا ہے کہ آپ کا مطالعہ پاولوویا سرور پر (404) دستیاب نہیں ہے۔ ایسا ہونے کے کئی طریقے ہیں۔ مسئلہ کو حل کرنے کا طریقہ یہاں ہے:\n1. یہ ایک لمحاتی مسئلہ تھا، اب ختم ہو گیا ہے۔ شاید پاولوویا مطالعہ کو دستیاب کرنے میں سست تھا، یا زیادہ سرور ٹریفک کی وجہ سے عارضی بندش تھی۔ اپنے براؤزر کے ایڈریس بار میں ریفریش بٹن ↻ پر کلک کرکے اسٹڈی پیج کو ریفریش کرنے کی کوشش کریں۔ آپ ایک سے زیادہ بار کوشش کر سکتے ہیں۔ اگر یہ دستیاب ہو جاتا ہے، تو آپ کا مطالعہ عام طور پر چلے گا۔\n2. اس میں ناکام ہونے پر، EasyEyes کمپائلر صفحہ پر، اپنے مطالعہ کے لیے Pavlovia ڈیش بورڈ کھولنے کے لیے "پاولوویا پر جائیں" بٹن (صفحہ کے نیچے دائیں جانب) پر کلک کریں۔\n3. پاولوویا ڈیش بورڈ میں، یقینی بنائیں کہ آپ کا مطالعہ "رننگ" موڈ میں ہے۔ اگر یہ غیر فعال ہے، تو رننگ بٹن کو دبائیں۔ دو سیکنڈ میں آپ کا مطالعہ رننگ موڈ میں بدل جائے گا، اور اب عام طور پر چل سکتا ہے۔ EasyEyes کمپائلر صفحہ پر واپس جائیں اور RUN پر کلک کریں، یا اسٹڈی یو آر ایل استعمال کریں۔\n4. اگر آپ کا غیر دستیاب مطالعہ پہلے سے ہی رننگ موڈ میں ہے، تو یہ عام طور پر اس بات کی نشاندہی کرتا ہے کہ آپ کے مطالعہ میں آن لائن ٹیسٹنگ کی ادائیگی کے لیے کریڈٹ/لائسنس کی کمی ہے۔ آگے بڑھنے کے تین طریقے ہیں۔\n5. پاولوویا ڈیش بورڈ سے مفت میں پائلٹ۔ اگر آپ چاہیں تو، آپ اپنے مطالعہ کو پائلٹنگ موڈ میں ڈالنے کے لیے پاولوویا ڈیش بورڈ میں پائلٹنگ بٹن پر کلک کر سکتے ہیں۔ پائلٹ بٹن (پاولوویا ڈیش بورڈ میں) دبا کر اپنا مطالعہ چلائیں۔ یہ مفت ہے، لیکن آپ کا مطالعہ URL دستیاب نہیں ہے۔\n6. کریڈٹ کے ساتھ آن لائن چلائیں۔ آن لائن چلانے کے لیے، اسی ڈیش بورڈ میں آپ پاولوویا سے کریڈٹ خرید سکتے ہیں اور کچھ اس مطالعہ کے لیے تفویض کر سکتے ہیں۔ یہ اس مطالعہ کو آن لائن چلانے کی اجازت دے گا۔\n7. لائسنس کے ساتھ آن لائن چلائیں۔ EasyEyes کے پاس Pavlovia کے لیے سائٹ کا لائسنس ہے۔ denis.pelli@nyu.edu پر لکھیں اور اپنی ای میل کو EasyEyes Pavlovia سائٹ کے لائسنس میں شامل کرنے کو کہیں۔ (یا، اگر آپ کے ادارے کے پاس Pavlovia سائٹ کا لائسنس ہے، تو آپ اس کے بجائے اسے استعمال کر سکتے ہیں۔) اپنا ای میل پتہ Pavlovia کے ڈیش بورڈ کو فراہم کریں تاکہ یہ ظاہر ہو کہ آپ لائسنس یافتہ ہیں، جسے Pavlovia مستقبل کے سیشنز میں یاد رکھے گی۔ یہ آپ کی تمام پڑھائیوں کو آن لائن چلانے کی اجازت دیتا ہے۔',
