    hi: '1. USB माइक्रोफ़ोन चुनें। अपने माइक्रोफ़ोन के USB-C केबल को इस कंप्यूटर में प्लग करें। कंप्यूटर का ऑडियो कंट्रोल पैनल खोलें।\n        Macintosh: सिस्टम सेटिंग्स > ध्वनि\n    ⊞ Windows: सेटिंग्स > ध्वनि > ध्वनि कंट्रोल पैनल\nइनपुट के रूप में अपना माइक्रोफ़ोन चुनें।\n\n2. सैंपलिंग दर चुनें। UMIK-1 केवल एक सैंपलिंग दर और बिट्स/सैंपल प्रदान करता है, इसलिए सेट करने के लिए कुछ भी नहीं है। UMIK-2 कई प्रदान करता है, जिन्हें आपको किसी ऐप या कंट्रोल पैनल का उपयोग करके सेट करना होगा:\n     Macintosh: Applications/Utilities/ फ़ोल्डर में Apple का Audio MIDI Setup.app।\n       ⊞ Windows: कंट्रोल पैनल > हार्डवेयर और ध्वनि > ऑडियो डिवाइस प्रबंधित करें\nUMIK-2 को [[N11]] Hz पर [[N22]] बिट्स/सैंपल के साथ सैंपल करने के लिए सेट करें। (आप अपने अध्ययन की स्प्रेडशीट में _calibrateSoundSamplingDesiredHz और _calibrateSoundSamplingDesiredBits सेट करके इस प्राथमिकता को बदल सकते हैं।)',
    hu: 'Loading...',
