    it: "SELEZIONA LA FREQUENZA DI CAMPIONAMENTO E I BIT PER CAMPIONE. Utilizza un'app o un pannello di controllo per impostare la frequenza di campionamento e i bit/campione dell'UMIK-2:\n      Macintosh: Audio MIDI Setup.app di Apple nella cartella Applicazioni/Utility/.\n      ⊞ Windows: Pannello di controllo > Hardware e suoni > Gestisci dispositivi audio\nImposta il campionamento a [[N11]] Hz con [[N22]] bit/campione.\nUna volta configurata, torna a questa pagina web e clicca su PROCEDI o premi INVIO.\n\n(La frequenza di campionamento e la profondità di bit richieste sono impostate dai parametri _calibrateSoundSamplingDesiredHz e _calibrateSoundSamplingDesiredBits nel foglio di calcolo dello studio.)",
