    pt: 'Loading...',
    ro: 'SELECTAȚI RATA DE EȘANTIONARE ȘI BIȚI PE EȘANȚĂ. Utilizați o aplicație sau un panou de control pentru a seta rata de eșantionare UMIK-2 și biți/probă:\n      Macintosh: Apple Audio MIDI Setup.app în folderul Aplicații/Utilități/.\n     ⊞ Windows: Panou de control > Hardware și sunet > Gestionare dispozitive audio\nSetați pentru eșantionare la [[N11]] Hz cu [[N22]] biți/probă. \nOdată configurat, reveniți la această pagină web și faceți clic pe PROCEED sau apăsați RETURN.\n\n(Rata de eșantionare și adâncimea de biți necesare sunt setate de parametrii _calibrateSoundSamplingDesiredHz și _calibrateSoundSamplingDesiredBits din foaia de calcul de studiu.)',
    ru: 'Loading...',
    sr: 'ОДАБЕРИТЕ БРЗИНУ УЗОРКОВАЊА И БИТОВЕ ПО УЗОРКУ. Користите апликацију или контролну таблу да бисте подесили брзину узорковања УМИК-2 и битове/узорак:\n      Мацинтосх: Аппле-ова Аудио МИДИ Сетуп.апп у фасцикли Апплицатионс/Утилитиес/.\n     ⊞ Виндовс: Контролна табла > Хардвер и звук > Управљање аудио уређајима\nПодесите на узорковање на [[Н11]] Хз са [[Н22]] битова/узорак. \nКада сте конфигурисани, вратите се на ову веб страницу и кликните на НАСТАВИ или притисните РЕТУРН.\n\n(Потребна брзина узорковања и дубина бита су постављени параметрима _цалибратеСоундСамплингДесиредХз и _цалибратеСоундСамплингДесиредБитс у табели студије.)',
