    fr: 'Loading...',
    de: 'Loading...',
    el: 'Loading...',
    he: 'בחר קצב דגימה וביטים לדגימה (macOS)\n\nאנא הגדר את התקן קלט השמע שלך (UMIK-2) באמצעות ההוראות שלהלן כדי לוודא שהוא תואם להגדרות הנדרשות:\nקצב דגימה: [[N11]] הרץ\nביטים לדגימה: [[N22]]-bit\n        1. פתח את Audio MIDI Setup (באפליקציות > Utilities).\n        2. בחר את המכשיר שלך (UMIK-2) בחלונית השמאלית.\n        3. תחת "פורמט", הגדר:\n        ● קצב דגימה: [[N11]] הרץ\n        ● עומק סיביות: [[N22]]-ביט\nלאחר ההגדרה, חזור לדף אינטרנט זה ולחץ על המשך או הקש על RETURN.\n\n(קצב הדגימה ועומק הסיביות הנדרשים נקבעים על ידי הפרמטרים _calibrateSoundSamplingDesiredHz ו-_calibrateSoundSamplingDesiredBits בגיליון האלקטרוני של המחקר.)',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'Loading...',
    id: 'Loading...',
    it: 'Loading...',
    ja: 'Loading...',
    kn: 'ಪ್ರತಿ ಮಾದರಿಗೆ ಮಾದರಿ ದರ ಮತ್ತು ಬಿಟ್‌ಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ (ಮ್ಯಾಕೋಸ್)\n\nದಯವಿಟ್ಟು ನಿಮ್ಮ ಆಡಿಯೊ ಇನ್‌ಪುಟ್ ಸಾಧನವನ್ನು (UMIK-2) ಕಾನ್ಫಿಗರ್ ಮಾಡಿ ಕೆಳಗಿನ ಸೂಚನೆಗಳನ್ನು ಬಳಸಿಕೊಂಡು ಅದು ಅಗತ್ಯವಿರುವ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ:\nಮಾದರಿ ದರ: [[N11]] Hz\nಪ್ರತಿ ಮಾದರಿಗೆ ಬಿಟ್‌ಗಳು: [[N22]]-ಬಿಟ್\n        1. ಆಡಿಯೊ MIDI ಸೆಟಪ್ ತೆರೆಯಿರಿ (ಅಪ್ಲಿಕೇಶನ್‌ಗಳು > ಉಪಯುಕ್ತತೆಗಳಲ್ಲಿ).\n        2. ಎಡಗೈ ಫಲಕದಲ್ಲಿ ನಿಮ್ಮ ಸಾಧನವನ್ನು (UMIK-2) ಆಯ್ಕೆಮಾಡಿ.\n        3. "ಫಾರ್ಮ್ಯಾಟ್" ಅಡಿಯಲ್ಲಿ ಹೊಂದಿಸಿ:\n        ● ಮಾದರಿ ದರ: [[N11]] Hz\n        ● ಬಿಟ್ ಆಳ: [[N22]]-ಬಿಟ್\nಒಮ್ಮೆ ಕಾನ್ಫಿಗರ್ ಮಾಡಿದ ನಂತರ, ಈ ವೆಬ್ ಪುಟಕ್ಕೆ ಹಿಂತಿರುಗಿ ಮತ್ತು ಮುಂದುವರಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ ಅಥವಾ ರಿಟರ್ನ್ ಒತ್ತಿರಿ.\n\n(ಅಗತ್ಯವಿರುವ ಮಾದರಿ ದರ ಮತ್ತು ಬಿಟ್ ಆಳವನ್ನು ಅಧ್ಯಯನ ಸ್ಪ್ರೆಡ್‌ಶೀಟ್‌ನಲ್ಲಿ _calibrateSoundSamplingDesiredHz ಮತ್ತು _calibrateSoundSamplingDesiredBits ನಿಯತಾಂಕಗಳಿಂದ ಹೊಂದಿಸಲಾಗಿದೆ.)',
    ko: '샘플링 레이트 및 샘플당 비트 수 선택(macOS)\n\n아래 지침에 따라 오디오 입력 장치(UMIK-2)를 구성하여 필요한 설정과 일치하는지 확인하세요.\n샘플링 레이트: [[N11]]Hz\n샘플당 비트 수: [[N22]]-비트\n1. 오디오 MIDI 설정(응용 프로그램 > 유틸리티)을 엽니다.\n2. 왼쪽 패널에서 장치(UMIK-2)를 선택합니다.\n3. "포맷"에서 다음을 설정합니다.\n● 샘플링 레이트: [[N11]]Hz\n● 비트 심도: [[N22]]-비트\n구성이 완료되면 이 웹 페이지로 돌아와 "진행"을 클릭하거나 "돌아가기"를 누르세요.\n\n(필요한 샘플링 레이트와 비트 심도는 학습 스프레드시트의 _calibrateSoundSamplingDesiredHz 및 _calibrateSoundSamplingDesiredBits 매개변수에 의해 설정됩니다.)',
