    tr: 'Loading...',
    ur: 'نمونے لینے کی شرح اور بٹس فی نمونہ منتخب کریں (macOS)\n\nبراہ کرم نیچے دی گئی ہدایات کا استعمال کرتے ہوئے اپنے آڈیو ان پٹ ڈیوائس (UMIK-2) کو ترتیب دیں تاکہ یہ یقینی بنایا جا سکے کہ یہ مطلوبہ ترتیبات سے میل کھاتا ہے۔\nنمونے لینے کی شرح: [[N11]] ہرٹج\nبٹس فی نمونہ: [[N22]]-bit\n        1. آڈیو MIDI سیٹ اپ کھولیں (ایپلی کیشنز > یوٹیلٹیز میں)۔\n        2. بائیں ہاتھ کے پینل میں اپنا آلہ (UMIK-2) منتخب کریں۔\n        3. "فارمیٹ" کے تحت سیٹ کریں:\n        ● نمونے لینے کی شرح: [[N11]] ہرٹج\n        ● بٹ کی گہرائی: [[N22]]-bit\nکنفیگر ہونے کے بعد، اس ویب پیج پر واپس جائیں اور آگے بڑھیں پر کلک کریں یا واپسی کو دبائیں۔\n\n(مطالعہ اسپریڈشیٹ میں نمونے لینے کی مطلوبہ شرح اور تھوڑا سا گہرائی پیرامیٹرز _calibrateSoundSamplingDesiredHz اور _calibrateSoundSamplingDesiredBits کے ذریعہ ترتیب دی گئی ہے۔)',
