    ja: 'Loading...',
    kn: 'Loading...',
    ko: 'Loading...',
    lt: 'PASIRINKITE ATĖMIMO DAŽĄ IR BITUS VIENAM MĖGINIUI („Linux“: „PulseAudio“ arba „PipeWire“)\n\nSukonfigūruokite garso įvesties įrenginį (UMIK-2) vadovaudamiesi toliau pateiktomis instrukcijomis, kad įsitikintumėte, jog jis atitinka reikiamus nustatymus:\nAtrankos dažnis: [[N11]] Hz\nBitai mėginiui: [[N22]] bitai\n1. Atidarykite „PulseAudio Volume Control“ („pavucontrol“) arba garso nustatymų programą.\n2. Skirtuke **Įvesties įrenginiai** pasirinkite įrenginį (UMIK-2).\n3. Redaguokite „/etc/pulse/daemon.conf“:\n   - „numatytasis atrankos dažnis = [[N11]]“.\n   - `default-sample-format = s[[N22]]le`\n4. Iš naujo paleiskite PulseAudio:\n   "pulseaudio -k && pulseaudio --start".\n5. Patvirtinkite atrankos dažnį skirtuke **Įrašymas** arba naudodami:\n   "arecord -f S[[N22]]_LE -r [[N11]] -D plughw:UMIK2 test.wav"\n\nSukonfigūravę grįžkite į šį tinklalapį ir spustelėkite Tęsti arba paspauskite GRĮŽTI.\n\n(Reikalingas atrankos dažnis ir bitų gylis nustatomi tyrimo skaičiuoklės parametrais _calibrateSoundSamplingDesiredHz ir _calibrateSoundSamplingDesiredBits.)',
    ms: 'Loading...',
    ml: 'Loading...',
    no: 'Loading...',
    fa: 'انتخاب نرخ نمونه برداری و بیت ها در هر نمونه (لینوکس: PulseAudio یا PipeWire)\n\nلطفاً دستگاه ورودی صوتی خود (UMIK-2) را با استفاده از دستورالعمل های زیر پیکربندی کنید تا مطمئن شوید که با تنظیمات مورد نیاز مطابقت دارد:\nنرخ نمونه برداری: [[N11]] هرتز\nبیت در هر نمونه: [[N22]] بیت\n1. PulseAudio Volume Control («pavucontrol») یا برنامه تنظیمات صوتی خود را باز کنید.\n2. دستگاه خود (UMIK-2) را در برگه **دستگاه های ورودی** انتخاب کنید.\n3. «/etc/pulse/daemon.conf» را ویرایش کنید:\n   - `default-sample-rate = [[N11]]`\n   - "default-sample-format = s[[N22]]le".\n4. PulseAudio را مجدداً راه اندازی کنید:\n   "pulseaudio -k && pulseaudio --start".\n5. نرخ نمونه برداری را در برگه **ضبط** یا با:\n   `arecord -f S[[N22]]_LE -r [[N11]] -D plughw:UMIK2 test.wav`\n\nپس از پیکربندی، به این صفحه وب بازگردید و روی PROCEED کلیک کنید یا RETURN را فشار دهید.\n\n(نرخ نمونه برداری و عمق بیت مورد نیاز توسط پارامترهای _calibrateSoundSamplingDesiredHz و _calibrateSoundSamplingDesiredBits در صفحه گسترده مطالعه تنظیم می شود.)',
