    hr: 'Loading...',
    cs: 'Loading...',
    da: 'Loading...',
    nl: 'Loading...',
    fi: 'Loading...',
    fr: 'Loading...',
    de: 'ABTASTERATE UND BITS PRO SAMPLE AUSWÄHLEN (Chrome OS)\n\nBitte konfigurieren Sie Ihr Audioeingabegerät (UMIK-2) anhand der folgenden Anweisungen, um sicherzustellen, dass es die erforderlichen Einstellungen erfüllt:\nAbtastrate: [[N11]] Hz\nBits pro Sample: [[N22]]-Bit\n\nIm Gegensatz zu macOS oder Windows verfügt Chrome OS nicht über integrierte Dienstprogramme zum Anpassen der Abtastrate oder Bittiefe. Es nutzt die Standardeinstellungen des angeschlossenen Audiogeräts. Wir empfehlen Ihnen, Ihr UMIK-2-Mikrofon auf einem kompatiblen System (z. B. macOS oder Windows) vorzukonfigurieren, bevor Sie es an Ihr Chromebook anschließen.\n\nKehren Sie nach der Konfiguration zu dieser Webseite zurück und klicken Sie auf „FORTFAHREN“ oder drücken Sie die Eingabetaste.\n\n(Die erforderliche Abtastrate und Bittiefe werden durch die Parameter „_calibrateSoundSamplingDesiredHz“ und „_calibrateSoundSamplingDesiredBits“ in der Studientabelle festgelegt.)',
    el: 'Loading...',
    he: 'Loading...',
    hi: 'Loading...',
    hu: 'Loading...',
    is: 'VELDU sýnishraða og BITA Á sýni (Chrome OS)\n\nVinsamlega stilltu hljóðinntakstækið þitt (UMIK-2) með því að nota leiðbeiningarnar hér að neðan til að tryggja að það passi við nauðsynlegar stillingar:\nSýnatökutíðni: [[N11]] Hz\nBitar á sýni: [[N22]]-biti\n\nÓlíkt macOS eða Windows er Chrome OS ekki með innbyggð tól til að stilla sýnatökuhraða eða bitadýpt. Það byggir á sjálfgefnum stillingum sem tengda hljóðtækið gefur. Þú ert hvattur til að forstilla UMIK-2 hljóðnemann þinn á samhæfu kerfi (t.d. macOS eða Windows) áður en þú tengir hann við Chromebook.\n\nÞegar það hefur verið stillt skaltu fara aftur á þessa vefsíðu og smella á ÁFRAM eða ýta á TILBAKA.\n\n(Tilskilið sýnatökuhraði og bitadýpt eru stillt með færibreytunum _calibrateSoundSamplingDesiredHz og _calibrateSoundSamplingDesiredBits í rannsóknartöflureikninum.)',
    id: 'Loading...',
    it: 'SELEZIONA FREQUENZA DI CAMPIONAMENTO E BIT PER CAMPIONE (Chrome OS)\n\nConfigura il tuo dispositivo di input audio (UMIK-2) seguendo le istruzioni riportate di seguito per assicurarti che corrisponda alle impostazioni richieste:\nFrequenza di campionamento: [[N11]] Hz\nBit per campione: [[N22]] bit\n\nA differenza di macOS o Windows, Chrome OS non dispone di utilità integrate per la regolazione della frequenza di campionamento o della profondità di bit. Si basa sulle configurazioni predefinite fornite dal dispositivo audio collegato. Ti consigliamo di preconfigurare il tuo microfono UMIK-2 su un sistema compatibile (ad esempio, macOS o Windows) prima di collegarlo al Chromebook.\n\nUna volta configurato, torna a questa pagina web e clicca su PROCEDI o premi INVIO.\n\n(La frequenza di campionamento e la profondità di bit richieste sono impostate dai parametri _calibrateSoundSamplingDesiredHz e _calibrateSoundSamplingDesiredBits nel foglio di calcolo dello studio.)',
