    he: '[אם אינך מקבל את ה-"אפשר ...", ונראה שהמחשב והסמארטפון תקועים, כשקוד ה-QR עדיין מופיע, אנא רענן את התקשורת שלהם. תחילה נסה לרענן את הדפדפן של הטלפון (הקש על כתובת; הקש על המשך). אם זה לא עובד, צא מהדפדפן של הטלפון (או הפעל מחדש את הטלפון) והשתמש במצלמת הטלפון כדי להתחבר מחדש לקוד ה-QR.]',
