    kn: '[ನೀವು "ಅನುಮತಿ ..." ಪಾಪ್ ಅಪ್ ಅನ್ನು ಪಡೆಯದಿದ್ದರೆ ಮತ್ತು ಕಂಪ್ಯೂಟರ್ ಮತ್ತು ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಅಂಟಿಕೊಂಡಂತೆ ತೋರುತ್ತಿದ್ದರೆ, QR ಕೋಡ್ ಇನ್ನೂ ತೋರಿಸುತ್ತಿದ್ದರೆ, ದಯವಿಟ್ಟು ಅವರ ಸಂವಹನವನ್ನು ರಿಫ್ರೆಶ್ ಮಾಡಿ. ಮೊದಲು ಫೋನ್‌ನ ಬ್ರೌಸರ್ ಅನ್ನು ರಿಫ್ರೆಶ್ ಮಾಡಲು ಪ್ರಯತ್ನಿಸಿ (ವಿಳಾಸವನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ; ಹೋಗಿ ಟ್ಯಾಪ್ ಮಾಡಿ). ಅದು ಕೆಲಸ ಮಾಡದಿದ್ದರೆ, ಫೋನ್‌ನ ಬ್ರೌಸರ್ ಅನ್ನು ತ್ಯಜಿಸಿ (ಅಥವಾ ನಿಮ್ಮ ಫೋನ್ ಅನ್ನು ಮರುಪ್ರಾರಂಭಿಸಿ), ಮತ್ತು QR ಕೋಡ್‌ಗೆ ಮರುಸಂಪರ್ಕಿಸಲು ನಿಮ್ಮ ಫೋನ್‌ನ ಕ್ಯಾಮರಾವನ್ನು ಬಳಸಿ.]',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: '[Jika anda tidak mendapat pop timbul "Benarkan ...", dan komputer serta telefon pintar kelihatan tersekat, dengan kod QR masih dipaparkan, sila muat semula komunikasi mereka. Mula-mula cuba muat semula penyemak imbas telefon (ketik alamat; ketik pergi). Jika itu tidak berjaya, keluar dari penyemak imbas telefon (atau mulakan semula telefon anda), dan gunakan kamera telefon anda untuk menyambung semula ke kod QR.]',
    ml: 'Loading...',
    no: 'Loading...',
    fa: '[اگر پاپ «Allow ...» را دریافت نکردید، و به نظر می‌رسد رایانه و تلفن هوشمند گیر کرده‌اند، با کد QR هنوز نشان داده می‌شود، لطفا ارتباط آن‌ها را تازه‌سازی کنید. ابتدا مرورگر گوشی را بازخوانی کنید (آدرس را ضربه بزنید؛ برو ضربه بزنید). اگر کار نکرد، از مرورگر تلفن خارج شوید (یا گوشی خود را مجددا راه اندازی کنید) و از دوربین تلفن خود برای اتصال مجدد به کد QR استفاده کنید.]',
    pl: 'Loading...',
