    sv: 'Loading...',
    tl: 'Loading...',
    tr: 'Loading...',
    ur: '[اگر آپ کو "اجازت دیں..." پاپ اپ نہیں ملتا ہے، اور لگتا ہے کہ کمپیوٹر اور سمارٹ فون پھنس گئے ہیں، QR کوڈ اب بھی دکھائی دے رہا ہے، تو براہ کرم ان کی بات چیت کو تازہ کریں۔ سب سے پہلے فون کے براؤزر کو ریفریش کرنے کی کوشش کریں (پتہ کو تھپتھپائیں؛ جائیں پر ٹیپ کریں)۔ اگر یہ کام نہیں کرتا ہے تو، فون کا براؤزر چھوڑ دیں (یا اپنے فون کو دوبارہ شروع کریں)، اور QR کوڈ سے دوبارہ جڑنے کے لیے اپنے فون کا کیمرہ استعمال کریں۔]',
