    lt: '1. Raskite savo internetinę kamerą – paprastai viršuje centre, dega balta arba žalia šviesa.\n2. Vadovaudamiesi šiomis instrukcijomis, trumpam pastatysite akį žinomu atstumu, kad internetinė kamera galėtų išmatuoti jūsų veidą.\n3. Naudokite vaizdo peržiūrą (apačioje kairėje), kad pakreiptumėte ekraną, kol akys bus nukreiptos vertikaliai.\n4. Išsirinkite ilgą daiktą (pvz., knygą, popierių, butelį, telefoną ar ranką). Ilgesnis yra geriau, iki žemiau esančios linijos ilgio.\n5. Venkite aštrių daiktų, pavyzdžiui, pieštukų.\n6. Jei naudojate ranką 🖐, matuokite nuo rausvos spalvos iki nykščio visiškai išskėstais pirštais.\n7. Laikykite objektą ekrane horizontaliai.\n8. Sulygiuokite jo KAIRĮ galą su KAIRĖJO žalia linija.\n9. Naudokite žymeklį arba ◀ ▶ klavišus, kad perkeltumėte DEŠININĮ žalią liniją, kad ji atitiktų DEŠINĮjį objekto galą.\n10. Pakelkite objektą ir juo nustatykite atstumą nuo akies iki internetinės kameros.\n11. Pasilenkite, kol jūsų akių atstumas nuo internetinės kameros atitiks objekto ilgį.\n12. Nejudėdami nuimkite objektą, kad žiniatinklio kamera aiškiai matytų jūsų veidą, ir paspauskite GRĮŽTI arba spustelėkite Tęsti.',
    ms: 'Loading...',
