    no: 'Loading...',
    fa: '1. وب کم خود را پیدا کنید - معمولاً در مرکز بالا، با نور سفید یا سبز.\n2. با پیروی از این دستورالعمل ها، به طور خلاصه چشم خود را در فاصله مشخصی قرار می دهید تا وب کم بتواند صورت شما را اندازه گیری کند.\n3. از پیش نمایش ویدیو (پایین سمت چپ) برای کج کردن صفحه نمایش تا زمانی که چشمان شما به صورت عمودی در مرکز قرار گیرند، استفاده کنید.\n4. یک شی بلند را انتخاب کنید (مانند کتاب، کاغذ، بطری، تلفن یا دستتان). طولانی تر بهتر است، تا طول خط زیر.\n5. از وسایل تیز مانند مداد خودداری کنید.\n6. در صورت استفاده از دست 🖐، از صورتی تا شست را با انگشتان کاملاً باز اندازه بگیرید.\n7. جسم را به صورت افقی روی صفحه نگه دارید.\n8. انتهای چپ آن را با خط سبز LEFT تراز کنید.\n9. از کلیدهای مکان نما یا ◀ ▶ برای حرکت دادن خط سبز RIGHT برای مطابقت با انتهای سمت راست شی استفاده کنید.\n10. شی را بالا بیاورید و از آن برای تنظیم فاصله چشم خود تا وب کم استفاده کنید.\n11. تا زمانی که فاصله چشم شما از وب‌کم با طول شی مطابقت داشته باشد به داخل خم شوید.\n12. در حالی که ثابت نگه داشته اید، جسم را بردارید تا وب کم نمای واضحی از صورت شما داشته باشد و RETURN یا روی ادامه کلیک کنید.',
