    ja: 'Loading...',
    kn: 'ಪ್ಲಾಟ್‌ಫಾರ್ಮ್ ಅನ್ನು ರಚಿಸಿ\nನಿಮ್ಮ ಫೋನ್ ಅನ್ನು ಆನ್ ಮಾಡಲು ನಮಗೆ ಎತ್ತರದ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್ (ಮಟ್ಟದ ಮೇಲ್ಮೈ) ಅಗತ್ಯವಿದೆ. ಈ ವೇದಿಕೆಯು ಗಾಜು, ಮಗ್, ಜಾರ್, ಕ್ಯಾನ್, ಬಾಕ್ಸ್ ಅಥವಾ ಪುಸ್ತಕಗಳ ಸ್ಟಾಕ್ ಆಗಿರಬಹುದು.\n\nಪ್ಲಾಟ್‌ಫಾರ್ಮ್ ಅನ್ನು ಇರಿಸಿ\n1. ನೀವು ಕೀಬೋರ್ಡ್‌ನಲ್ಲಿ ಸ್ಪೀಕರ್‌ಗಳನ್ನು ಹೊಂದಿರುವ ಲ್ಯಾಪ್‌ಟಾಪ್ ಅನ್ನು ಬಳಸುತ್ತಿದ್ದರೆ, ನಿಮ್ಮ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್ ಅನ್ನು ನಿಮ್ಮ ಮತ್ತು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ನಡುವಿನ ಟೇಬಲ್‌ನಲ್ಲಿ ಕೀಬೋರ್ಡ್ ಬಳಿ ಇರಿಸಿ.\n\n2. ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ಬೇರೆಡೆಯಲ್ಲಿ ಸ್ಪೀಕರ್‌ಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ನಿಮ್ಮ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್ ಅನ್ನು ನಿಮ್ಮ ಮತ್ತು ಸ್ಪೀಕರ್‌ಗಳ ನಡುವೆ ಮೇಜಿನ ಮೇಲೆ ಇರಿಸಿ ಇದರಿಂದ ನಿಮ್ಮ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್‌ನಲ್ಲಿರುವ ಫೋನ್‌ನ ದೂರದ ತುದಿಯು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ಅನ್ನು ಬಳಸುವಾಗ ಸ್ಪೀಕರ್‌ಗಳು ಮತ್ತು ನಿಮ್ಮ ಕಣ್ಣುಗಳ ನಡುವೆ ಅರ್ಧದಷ್ಟು ಇರುತ್ತದೆ.\n\nಪ್ಲಾಟ್‌ಫಾರ್ಮ್ ಎತ್ತರವನ್ನು ಹೊಂದಿಸಿ\nಸರಿಯಾದ ಎತ್ತರವನ್ನು ತಲುಪಲು ನೀವು ಪುಸ್ತಕಗಳು ಮತ್ತು ಗಾಜಿನಂತಹ ವಸ್ತುಗಳನ್ನು ಜೋಡಿಸಬಹುದು. ನಿಮ್ಮ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್ ಅನ್ನು ಸಾಕಷ್ಟು ಎತ್ತರವಾಗಿಸಿ ಆದ್ದರಿಂದ ಸ್ಪೀಕರ್‌ಗಳ ನಡುವಿನ ಎತ್ತರದಲ್ಲಿ ಮಧ್ಯಂತರವಾಗಿದೆ ಮತ್ತು ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ಅನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ಮೇಜಿನ ಬಳಿ ಕುಳಿತಿರುವಾಗ ನಿಮ್ಮ ಕಣ್ಣುಗಳು ಎಲ್ಲಿವೆ.\n\nಸಿದ್ಧವಾಗಿದೆಯೇ?\nನಿಮ್ಮ ಪ್ಲಾಟ್‌ಫಾರ್ಮ್ ಸಿದ್ಧವಾದಾಗ, ರಿಟರ್ನ್ ಒತ್ತಿರಿ ಅಥವಾ ಮುಂದುವರಿಸಲು ಮುಂದುವರಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ.',
    ko: 'Loading...',
    lt: 'Loading...',
    ms: 'BUAT PLATFORM\nKami memerlukan platform yang dinaikkan (permukaan rata) untuk menghidupkan telefon anda. Platform ini boleh berupa gelas, mug, balang, tin, kotak atau timbunan buku.\n\nLETAK PLATFORM\n1. Jika anda menggunakan komputer riba dengan pembesar suara terbina pada papan kekunci, letakkan platform anda di atas meja antara anda dan komputer anda, berhampiran papan kekunci.\n\n2. Jika komputer anda mempunyai pembesar suara yang terletak di tempat lain, letakkan platform anda di atas meja antara anda dan pembesar suara supaya hujung telefon pada platform anda berada di tengah-tengah antara pembesar suara dan mata anda apabila anda menggunakan komputer anda.\n\nLARASKAN TINGGI PLATFORM\nAnda boleh menyusun item, seperti buku dan gelas, untuk mencapai ketinggian yang betul. Jadikan platform anda cukup tinggi supaya ketinggiannya sederhana antara pembesar suara dan tempat mata anda apabila anda duduk di meja menggunakan komputer anda.\n\nSEDIA?\nApabila platform anda sudah sedia, tekan RETURN atau klik PROCEED untuk meneruskan.',
