    fi: 'Loading...',
    fr: 'Loading...',
    de: '3. MIKROFON AN DER UNTERKANTE. Wenn Ihr Telefon vertikal steht, befindet sich das Mikrofon an der Unterkante.\n4. HÜLLE ENTFERNEN. Entfernen Sie die Schutzhülle, um das Mikrofon Ihres Telefons freizulegen.\n5. LEGEN SIE DAS TELEFON AUF EIN HOHES TRINKGLAS (oder eine Kaffeetasse, eine Getränke-/Bierdose, ein Glas, eine Schachtel oder einen Bücherstapel) zwischen Ihnen und Ihrer Tastatur, sodass die (untere) Mikrofonkante zum Computer zeigt.\n      Laptop-Lautsprecher befinden sich in der Tastatur. Platzieren Sie Ihr Telefon so, dass sich das Mikrofon in Sichtweite zur Tastatur befindet.\n      Desktop-Lautsprecher befinden sich hinter einem Gitter. Richten Sie Ihr Telefon auf das Gitter.\n6. Unten wird die Schaltfläche „FORTFAHREN“ angezeigt. Klicken Sie darauf, um mit der Kalibrierung zu beginnen.',
