    it: "3. IL MICROFONO È SUL BORDO INFERIORE. Quando il telefono è in posizione verticale, il microfono si trova sul bordo inferiore.\n4. RIMUOVERE LA CUSTODIA. Esporre il microfono del telefono rimuovendo l'eventuale custodia protettiva.\n5. APPOGGIARE IL TELEFONO SU UN BICCHIERE ALTO (o una tazza da caffè, una lattina di bibita/birra, un barattolo, una scatola o una pila di libri), tra sé e la tastiera, con il bordo (inferiore) del microfono rivolto verso il computer.\n      Gli altoparlanti del laptop sono integrati nella tastiera; posizionare il telefono in modo che il microfono sia sulla linea visiva della tastiera.\n      Gli altoparlanti del desktop sono dietro una griglia; puntare il telefono verso la griglia.\n6. Apparirà un pulsante PROCEDI in basso. Cliccare per avviare la calibrazione.",
