    ur: '3. MIC۔ نچلے کنارے میں ہے۔ جب آپ کا فون عمودی ہوتا ہے تو اس کا مائیکروفون نچلے کنارے میں ہوتا ہے۔\n4. کیس کو ہٹا دیں۔ کسی بھی حفاظتی کیس کو ہٹا کر اپنے فون کے مائیکروفون کو بے نقاب کریں۔\n5. فون کو ایک لمبے پینے کے گلاس (یا کافی کا مگ یا سوڈا/بیئر کین یا جار یا باکس یا کتابوں کے ڈھیر) پر، اپنے اور آپ کے کی بورڈ کے درمیان، مائیکروفون (نیچے) کے کنارے کے ساتھ آپ کے کمپیوٹر کی طرف رکھیں۔ \n     لیپ ٹاپ اسپیکر کی بورڈ میں ہیں؛ اپنے فون کو اس طرح رکھیں کہ اس کا مائیکروفون آپ کی نظر کی بورڈ پر ہو۔ \n     ڈیسک ٹاپ اسپیکر ایک گرل کے پیچھے ہیں؛ اپنے فون کو گرل کی طرف رکھیں۔\n6. نیچے ایک PROCEED بٹن ظاہر ہوگا۔ کیلیبریشن شروع کرنے کے لیے اس پر کلک کریں۔',
