    he: '3. הגדר מיקרופון. \n א. פרש את שלושת רגלי החצובה עד הסוף. \n ב. תפס המיקרופון של החצובה נמצא על מסתובב. סובב את הקליפ עד הצד לאיזה צד שמגביר את הקצה הגבוה ביותר של הקליפ. \n ג. הכנס את המיקרופון לקליפס החצובה, מלמטה, עד שהקצה התחתון של המיקרופון ישתלב עם הקצה הנמוך ביותר של הקליפ. \n ד. כוונן את ההטיה כדי להפוך את המיקרופון לאנכי, מצביע עד לתקרה. \n ה. הנח את החצובה על השולחן בינך לבין המחשב שלך. סובב את החצובה כדי להביא את המיקרופון לצדך. \n ו. דחוף את החצובה לכיוון המחשב שלך (או כל מה שיש בו את הרמקולים) עד ששתי הרגליים הרחוקות של החצובה כמעט נוגעות בה, והרגל השלישית קרובה אליך.\n4. לחצן המשך יופיע למטה. לחץ עליו כדי להתחיל בכיול.',
