    ko: '3. 마이크 설치\n  a. 삼각대 다리 세 개를 최대한 벌립니다.\n  b. 삼각대의 마이크 클립이 회전합니다. 클립의 가장 높은 쪽 가장자리가 더 높은 쪽까지 클립을 완전히 돌립니다.\n  c. 마이크의 아래쪽 끝이 클립의 가장 낮은 쪽 가장자리와 맞닿을 때까지 아래에서 위로 마이크를 삼각대 클립에 삽입합니다.\n  d. 기울기를 조정하여 마이크가 수직이 되고 천장을 향하도록 합니다.\n  e. 삼각대를 사용자와 컴퓨터 사이의 테이블에 놓습니다. 삼각대를 돌려 마이크가 사용자 쪽으로 오도록 합니다.\n  f. 삼각대의 가장 먼 쪽 두 다리가 컴퓨터(또는 스피커가 있는 곳)에 거의 닿고 세 번째 다리가 사용자 가까이 올 때까지 삼각대를 컴퓨터(또는 스피커가 있는 곳) 쪽으로 밉니다.\n4. 아래에 진행 버튼이 나타납니다. 클릭하여 보정을 시작합니다.',
