    ur: '3. مائیکروفون سیٹ اپ کریں۔ \n a تین تپائی ٹانگوں کو پھیلائیں جہاں تک وہ جائیں گے۔ \n ب تپائی کا مائیکروفون کلپ ایک کنڈا پر ہے۔ کلپ کو پوری طرح گھمائیں جس طرف بھی کلپ کے سب سے اونچے کنارے کو اونچا بناتا ہے۔ \n c مائیکروفون کو تپائی کلپ میں نیچے سے داخل کریں، جب تک کہ مائیکروفون کا نچلا سرا کلپ کے سب سے نچلے کنارے کے ساتھ فلش نہ ہوجائے۔ \n d مائیکروفون کو عمودی بنانے کے لیے، چھت کی طرف اشارہ کرتے ہوئے جھکاؤ کو ایڈجسٹ کریں۔ \n e تپائی کو اپنے اور اپنے کمپیوٹر کے درمیان میز پر رکھیں۔ مائکروفون کو اپنی طرف لانے کے لیے تپائی کو گھمائیں۔ \n f تپائی کو اپنے کمپیوٹر کی طرف دھکیلیں (یا جس میں بھی اسپیکر ہیں) جب تک کہ تپائی کی دو ٹانگیں اسے چھونے لگیں اور تیسری ٹانگ آپ کے قریب نہ ہو۔\n4. نیچے ایک PROCEED بٹن ظاہر ہوگا۔ کیلیبریشن شروع کرنے کے لیے اس پر کلک کریں۔',
