    fr: 'Loading...',
    de: 'showMeasuredSoundLevelBool ist unter einer oder mehreren Bedingungen TRUE, daher wird für diese Messungen ein Mikrofon benötigt.\n1. SCHLIESSEN SIE Ihr miniDSP UMIK-1 oder 2 Mikrofon an diesen Computer an.\n2. WÄHLEN SIE das Mikrofon im unten stehenden Popup-Fenster für die Toneingabe aus.\n3. WÄHLEN SIE den Modellnamen des Mikrofons, UMIK-1 oder 2.\n4. Geben Sie die Seriennummer ein und klicken Sie auf die Schaltfläche „PROFIL ABRUFEN“.\n5. MIKROFON EINRICHTEN\n a. Spreizen Sie die drei Stativbeine so weit wie möglich auseinander.\n  b. Der Mikrofonclip des Stativs ist schwenkbar. Schwenken Sie den Clip ganz nach oben, sodass die höchste Kante des Clips höher liegt.\n  c. Setzen Sie das Mikrofon von unten in den Stativclip ein, bis das untere Ende des Mikrofons bündig mit der untersten Kante des Clips abschließt.\n  d. Passen Sie die Neigung so an, dass das Mikrofon vertikal zur Decke zeigt.\ne. Stellen Sie das Stativ zwischen sich und Ihren Computer auf den Tisch. Drehen Sie das Stativ, um das Mikrofon an Ihre Seite zu bringen.\n  f. Schieben Sie das Stativ in Richtung Ihres Computers (oder des Lautsprechersystems), bis die beiden entferntesten Beine des Stativs ihn fast berühren und das dritte Bein in Ihrer Nähe ist.\n6. MIKROFONVERWENDUNG ERLAUBEN. Wenn Sie in einem Popup-Fenster um Erlaubnis zur Mikrofonverwendung gebeten werden, klicken Sie auf „Zulassen“.\n7. ⇧🔊 MAXIMALE LAUTSTÄRKE. Für eine genaue Lautstärkemessung maximieren Sie bitte jetzt die Lautstärke Ihres Computers und ändern Sie die Lautstärke bis zum Ende der Sitzung nicht mehr.\n8. Klicken Sie auf „FORTFAHREN“ oder drücken Sie die EINGABETASTE.',
