    it: 'showMeasuredSoundLevelBool è TRUE in una o più condizioni, quindi è necessario un microfono per effettuare tali misurazioni.\n1. COLLEGA il tuo microfono miniDSP UMIK-1 o 2 a questo computer.\n2. SELEZIONARE il microfono nel pop-up di ingresso audio qui sotto.\n3. SELEZIONARE il nome del modello del microfono, UMIK-1 o 2.\n4. Inserire il numero di serie e fare clic sul pulsante "PRENDI PROFILO".\n5. IMPOSTARE IL MICROFONO\n a. Allargare le tre gambe del treppiede il più possibile.\n  b. La clip del microfono del treppiede è dotata di un perno. Ruotare la clip completamente verso il lato che rende più alto il bordo più alto della clip.\n  c. Inserire il microfono nella clip del treppiede, dal basso, finché l\'estremità inferiore del microfono non è a filo con il bordo più basso della clip.\n  d. Regolare l\'inclinazione per rendere il microfono verticale, puntandolo verso il soffitto.\n e. Posiziona il treppiede sul tavolo tra te e il computer. Ruota il treppiede per portare il microfono al tuo fianco.\n  f. Spingi il treppiede verso il computer (o qualsiasi dispositivo con gli altoparlanti) finché le due gambe più lontane del treppiede non lo toccano quasi e la terza gamba è vicina a te.\n6. CONSENTI L\'USO DEL MICROFONO. Se un pop-up chiede l\'autorizzazione per utilizzare il microfono, clicca su "Consenti".\n7. ⇧🔊 VOLUME MASSIMO. Per una misurazione accurata del suono, alza al massimo il volume del computer ora e non toccarlo fino al termine della sessione.\n8. Clicca su PROCEDI o premi INVIO.',
