    ur: 'showMeasuredSoundLevelBool ایک یا زیادہ حالات میں درست ہے، لہذا ان پیمائشوں کو بنانے کے لیے ایک مائکروفون کی ضرورت ہے۔\n1. اپنے miniDSP UMIK-1 یا 2 مائکروفون کو اس کمپیوٹر سے جوڑیں۔\n2. نیچے دیے گئے ساؤنڈ ان پٹ پاپ اپ پر اس مائکروفون کو منتخب کریں۔\n3. مائیکروفون ماڈل کا نام منتخب کریں، UMIK-1 یا 2۔\n4. سیریل نمبر درج کریں، اور FETCH PROFILE بٹن پر کلک کریں۔\n5. مائیکروفون سیٹ اپ کریں۔\n a تین تپائی ٹانگوں کو پھیلائیں جہاں تک وہ جائیں گے۔ \n ب تپائی کا مائیکروفون کلپ ایک کنڈا پر ہے۔ کلپ کو پوری طرح گھمائیں جس طرف بھی کلپ کے سب سے اونچے کنارے کو اونچا بناتا ہے۔ \n c مائیکروفون کو تپائی کلپ میں نیچے سے داخل کریں، جب تک کہ مائیکروفون کا نچلا سرا کلپ کے سب سے نچلے کنارے کے ساتھ فلش نہ ہوجائے۔ \n d مائیکروفون کو عمودی بنانے کے لیے، چھت کی طرف اشارہ کرتے ہوئے جھکاؤ کو ایڈجسٹ کریں۔ \n e تپائی کو اپنے اور اپنے کمپیوٹر کے درمیان میز پر رکھیں۔ مائکروفون کو اپنی طرف لانے کے لیے تپائی کو گھمائیں۔ \n f تپائی کو اپنے کمپیوٹر کی طرف دھکیلیں (یا جس میں بھی اسپیکر ہیں) جب تک کہ تپائی کی دو ٹانگیں اسے چھونے لگیں اور تیسری ٹانگ آپ کے قریب نہ ہو۔\n6. مائیکروفون کے استعمال کی اجازت دیں۔ اگر کوئی پاپ اپ مائیکروفون استعمال کرنے کی اجازت طلب کرتا ہے، تو "اجازت دیں" پر کلک کریں۔\n7. ⇧🔊 زیادہ سے زیادہ حجم۔ آواز کی درست پیمائش کے لیے، براہ کرم اپنے کمپیوٹر کی آواز والیوم کو ابھی زیادہ سے زیادہ کریں، اور پھر سیشن ختم ہونے تک والیوم کو مت چھوئیں۔\n8. آگے بڑھیں پر کلک کریں یا واپسی کو دبائیں۔',
