    hi: '⇧🔊 अधिकतम वॉल्यूम। सटीक ध्वनि अंशांकन के लिए, कृपया अंशांकन से पहले अपने कंप्यूटर की ध्वनि की मात्रा को अधिकतम करें, और फिर सत्र समाप्त होने तक वॉल्यूम को न छुएं।\nहेडफ़ोन का उपयोग न करें। हेडफ़ोन/ईयरबड्स को निकालकर डिस्कनेक्ट कर दें।\nQR लिंक प्राप्त करने के लिए कैमरे का उपयोग करें। जब नीचे QR कोड दिखाई दे, तो अपने स्मार्टफ़ोन के कैमरे को उस पर इंगित करें, और अपने स्मार्टफ़ोन स्क्रीन पर दिखाई देने वाले लिंक पर क्लिक करें। फिर स्मार्टफ़ोन स्क्रीन पर दिए गए निर्देशों का पालन करें।\n—————————————————————————————————————————\nकृपया शांत रहें! अभी रिकॉर्डिंग चल रही है। वॉल्यूम नियंत्रण को न छुएं।\n—————————————————————————————————————————\nसमस्या?\n1. आपके लैपटॉप पर EasyEyes चलाने वाला मुख्य वेब पेज आपके स्मार्टफ़ोन पर QR-लिंक्ड वेबपेज से जुड़ने के लिए webRTC प्रोटोकॉल का इस्तेमाल करता है। यह प्रोटोकॉल कनेक्ट करने के कई तरीकों में से सबसे अच्छा तरीका ढूँढ़ता है। सबसे अच्छा तरीका तब होता है जब आपका फ़ोन और कंप्यूटर दोनों एक ही वाई-फ़ाई नेटवर्क पर हों।\n\n2. अगर आपका स्मार्टफ़ोन कनेक्शन में कोई त्रुटि दिखाता है, तो ब्राउज़र बंद करके उसे फिर से चालू करें, या स्मार्टफ़ोन को फिर से चालू भी करें।\n\n3. ऐसा कम ही होता है, लेकिन अगर आवाज़ नहीं आती है, या बजने के बाद भी आगे बढ़ें बटन दिखाई नहीं देता है, तो इसका मतलब है कि कैलिब्रेशन विफल हो गया है। आप इस ब्राउज़र पेज को रीफ़्रेश करके फिर से कोशिश कर सकते हैं: पता टैप करें; आगे बढ़ें टैप करें। आमतौर पर इससे काम हो जाता है।',
