    lt: '⇧🔊 DIDŽIAUSIA TŪRIS. Norėdami tiksliai sukalibruoti garsą, padidinkite kompiuterio garso garsumą dabar, prieš kalibravimą, tada nelieskite garsumo iki seanso pabaigos.\nJOKIŲ AUSINIŲ. Išimkite ir atjunkite visas ausines / ausines.\nNAUDOKITE KAMERĄ, KAD GAUTI QR NUORODĄ. Kai toliau pasirodys QR kodas, nukreipkite į jį savo išmaniojo telefono kamerą ir spustelėkite nuorodą, kuri pasirodo išmaniojo telefono ekrane. Tada vykdykite instrukcijas išmaniojo telefono ekrane.\n———————————————————————————————————————————\nTYLAI PRAŠAU! DABAR ĮRAŠYMAS. NELIESKITE GARSUMO VALDIKLIO.\n———————————————————————————————————————————\nPROBLEMA?                                                                                                                                 \n1. Pagrindinis tinklalapis, kuriame jūsų nešiojamajame kompiuteryje veikia „EasyEyes“, naudoja webRTC protokolą, kad galėtų kalbėtis su QR nuoroda susietu tinklalapiu jūsų išmaniajame telefone. Šis protokolas ieško geriausių būdų prisijungti. Geriausia, kai jūsų telefonas ir kompiuteris yra tame pačiame „WiFi“ tinkle.\n                                                                                                                                 \n2. Jei jūsų išmanusis telefonas praneša apie ryšio klaidą, pabandykite išjungti ir iš naujo paleisti išmaniojo telefono naršyklę arba net iš naujo paleisti išmanųjį telefoną.\n                                                                                                                             \n3. Tai reta, bet jei garsas neskamba arba jam pasirodžius nerodomas mygtukas Tęsti, tai reiškia, kad kalibravimas nepavyko. Galite bandyti dar kartą atnaujindami šį naršyklės puslapį: bakstelėkite adresą; bakstelėkite eiti. Paprastai tai padaro.',
