    fa: '⇧🔊 حداکثر حجم. برای کالیبراسیون دقیق صدا، لطفاً قبل از کالیبره کردن، حجم صدای رایانه خود را به حداکثر برسانید و سپس تا پایان جلسه، صدا را لمس نکنید.\nبدون هدفون هر هدفون / هدفون را بردارید و جدا کنید.\nبرای دریافت پیوند QR از دوربین استفاده کنید. هنگامی که کد QR در زیر ظاهر شد، دوربین تلفن هوشمند خود را به سمت آن بگیرید و روی پیوندی که روی صفحه نمایش تلفن هوشمند شما ظاهر می شود کلیک کنید. سپس دستورالعمل های روی صفحه گوشی هوشمند را دنبال کنید.\n————————————————————————————————————————\nساکت لطفا! اکنون در حال ضبط کنترل صدا را لمس نکنید.\n————————————————————————————————————————\nمشکل؟                                                                                                                                 \n1. صفحه وب اصلی که EasyEyes را روی لپ تاپ شما اجرا می کند، از پروتکل webRTC برای صحبت با صفحه وب مرتبط با QR در تلفن هوشمند شما استفاده می کند. این پروتکل به دنبال بهترین روش های مختلف برای اتصال است. بهترین حالت زمانی است که تلفن و رایانه شما هر دو در یک شبکه WiFi باشند.\n                                                                                                                                 \n2. اگر تلفن هوشمند شما خطایی در اتصال گزارش کرد، سعی کنید مرورگر تلفن هوشمند را ترک کرده و مجدداً راه اندازی کنید یا حتی تلفن هوشمند را مجدداً راه اندازی کنید.\n                                                                                                                             \n3. نادر است، اما، اگر صدا پخش نشد، یا بعد از پخش، دکمه Proceed ظاهر نشد، به این معنی است که کالیبراسیون انجام نشد. می توانید با بازخوانی این صفحه مرورگر دوباره امتحان کنید: روی آدرس ضربه بزنید. برو ضربه بزنید. این معمولاً کار را انجام می دهد.',
