    fa: 'در هر آزمایش، در حالی که به صلیب نگاه می کنید، یک جفت خط در جایی چشمک می زند. شاید جایی که شما به دنبال آن هستید. شاید در گوشه چشم شما فقط یک فلش برای یادگیری کار، اجازه دهید ابتدا آن را با یک صفحه نمایش STATIC امتحان کنیم. در حالی که به صلیب، زیر، بدون حرکت چشمان خود نگاه می کنید: آیا خط بالایی نسبت به خط پایین به چپ یا راست منتقل شده است؟ \n\n              + |\n                                |\n\nبه سمت چپ منتقل شده است. این صفحه نمایش ثابت است، بنابراین به راحتی می توان چشمان خود را به خطوط حرکت داد و شیفت را مشخص کرد. اما، در یک آزمایش واقعی، خطوط فلش می شوند، بنابراین زمانی برای حرکت دادن چشمان شما وجود ندارد. مهم است که هنگام شروع هر آزمایش به صلیب نگاه کنید. خطوط بلافاصله چشمک می زنند. مهم نیست چشمان شما بعد از فلاش به کجا می رود. اولین بلوک آزمایش فقط چند آزمایش تمرین است، قبل از اینکه به طور جدی شروع کنیم.',
